import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
class App extends Component {
  state = {
    resultCount: 0
  };
  searchZillow = async (event) => {
    event.preventDefault();
    let response = await fetch('/zillow');
    let body = await response.json();
    this.setState({ resultCount: body.searchList.totalResultCount });
  }
  render() {
    const {greeting, isLoading} = this.state;
    return (
<div className="App">
<header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
<div className="App-intro">
            <button onClick={(event)=>this.searchZillow(event)}>US Results</button>
<h2>Properties Found {this.state.resultCount}</h2>
        </div>
        </header>
    </div>
    );
  }
}
export default App;
